RECORDS["_125"] = new MedievalDocuments("_125", 1655, "Stan, fiul lui Hamza din Leordeni, vinde lui Vasile din Budișteni un loc la Crângureni <j. Muscel>, cu 22 de costande.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stan", null, "Țara Românească", "2");
RECORDS["_126"] = new MedievalDocuments("_126", 1655, "Constantin Șerban voievod întărește mănăstirii Dintr-un Lemn vinăriciul domnesc de la satul Pietrarii, j. Vâlcea.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_127"] = new MedievalDocuments("_127", 1655, "Constantin Șerban voievod poruncește lui Serafim episcopul de Buzău să dea lui Andrei călărașul din Târgoviște, fetele unei Țigănci fugită de la el de multă vreme și adăpostită la Episcopie, unde a și murit.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_128"] = new MedievalDocuments("_128", 1655, "Megieșii din Cheia mărturisesc dreptul pe care îl au feciorii popei Ion din Craiova asupra unor părți din Cheia, moștenite de la mama lor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Megieșii din Cheia", null, "Țara Românească", "2");
RECORDS["_129"] = new MedievalDocuments("_129", 1655, "Constantin Șerban voievod întărește mănăstirii Glavacioc și egumenului Nichifor satul Obislav, j. Vlașca, cu toți rumânii.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "2");
RECORDS["_130"] = new MedievalDocuments("_130", 1655, "Constantin Șerban voievod întărește mănăstirii Jitian și egumenului Ionichie merticul de sare de la Ocna Mare, 150 de bolovani pe an.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "2");
RECORDS["_131"] = new MedievalDocuments("_131", 1655, "Mircea și cu frații săi, feciorii lui Dobre stolnic din Târnava, vând lui Costin căpitan un vad de moară, cu 12 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mircea și cu frații săi", null, "Țara Românească", "2");
RECORDS["_132"] = new MedievalDocuments("_132", 1655, "Doi boieri luați pe răvașe domnești de Filip din Vărăști, jură înaintea omului domnesc că Dumitru armaș nu l-a întrebat pe acesta atunci când și-a vândut partea lui de moșie din Vărăști <j. Ilfov>.", "Română", null, "Copie", "Constantin Șerban", "Doi boieri", null, "Țara Românească", "2");
RECORDS["_133"] = new MedievalDocuments("_133", 1655, "Florescul paharnic, fiul lui Socol clucer din Cornățeni, vinde vărului său, Tudoran paharnic, vii în dealul Piteștilor, casele vechi, două jgheaburi și o delniță.", "Română", "Hârtie", "Original", "Constantin Șerban", "Florescul", null, "Țara Românească", "2");
RECORDS["_134"] = new MedievalDocuments("_134", 1655, "Constantin Șerban voievod poruncește lui Drăgan Sârbul, Gherghie, Stan și Tudoran din Argeș, să nu-i mai asuprească pentru datorii vechi pe popa Ivașco, pe tatăl acestuia, Stanciu, și pe fiii lui din oraș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_135"] = new MedievalDocuments("_135", 1655, "Stroe vinde lui Stoica și fiilor săi un pogon și jumătate de vie în Săpatul, cu 8 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stroe", null, "Țara Românească", "2");
RECORDS["_136"] = new MedievalDocuments("_136", 1655, "Constantin Șerban voievod poruncește tuturor slujitorilor, roșiilor, spătăreilor, păhărniceilor, călărașilor, dărăbanților și altora, să dea înapoi tot ce au jefuit de la mănăstirea Brâncoveni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_137"] = new MedievalDocuments("_137", 1655, "Elina Buzeasca băneasa, soția banului Radu Buzescu, cu fiul ei Matei, dau zapis la mana lui Pătrașco paharnicul din Morânglavi, ca să stăpânească în pace o țigancă care a fost a mănăstirii Stănești <j. Vâlcea>, dând schimb mănăstirii trei boi și un cal.", "Română", null, "Copie", "Constantin Șerban", "Elina Buzeasca", null, "Țara Românească", "2");
RECORDS["_138"] = new MedievalDocuments("_138", 1655, "Preda spătarul cu vărul său Matei dau zapis la mana lui Pătrașco din Morânglavi ca să stăpânească pe Rada țiganca, care a fost a mănăstirii Stănești, <j. Vâlcea>, dând schimb mănăstirii trei boi și un cal.", "Română", null, "Copie", "Constantin Șerban", "Preda", null, "Țara Românească", "2");
RECORDS["_139"] = new MedievalDocuments("_139", 1655, "Sătenii din Turburea, j. Dolj, împrumută de la Pană postelnic din Pârdești 218 ughi iar dobânda banilor o plătesc cu muncă.", "Română", "Hârtie", "Original", "Constantin Șerban", "Sătenii din Turburea", null, "Țara Românească", "2");
RECORDS["_140"] = new MedievalDocuments("_140", 1655, "Jupâneasa Evda și fiul ei, Negoiță, adeveresc că eliberează din rumânie pe Brăiești pentru „că sunt oamnei drepți”, după ce s-au judecat în mai multe rânduri.", "Română", "Hârtie", "Original", "Constantin Șerban", "Jupâneasa Evda și fiul ei, Negoiță", null, "Țara Românească", "2");
RECORDS["_141"] = new MedievalDocuments("_141", 1655, "Constantin Șerban voievod poruncește celor douăzeci și patru de boieri luați de egumenul Ignatie de la mănăstirea Mihai Vodă din București să jure dacă Dan și Francul sunt rumânii mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_142"] = new MedievalDocuments("_142", 1655, "Grigore, egumenul de la mănăstirea Stănești <j. Vâlcea>, lasă în stăpânirea lui Pătrașco paharnicul și a fratelui lui, Giura, o țigancă pe nume Rada, primind în schimb 3 boi și un cal, cu știrea ctitorilor Preda spătarul din Cepturoaia și Matei postelnicul din Strezești, fiul banului Buzescu.", "Română", null, "Copie", "Constantin Șerban", "Grigore", null, "Țara Românească", "2");
RECORDS["_143"] = new MedievalDocuments("_143", 1655, "Calotă dă Afimiei și fetelor ei, în schimbul ocinei vândute din deal, ocina Bălăucăi din vale, din Jugulie <j. Romanați>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Calotă", null, "Țara Românească", "2");
RECORDS["_144"] = new MedievalDocuments("_144", 1655, "Chira armaș și Itovoi vătaf, ispravnicii scaunului Craiovei, poruncesc Stancăi a lui Giura paharnic din Mostiște să plătească popii Tatomir din Bărăști 12 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Chira armaș și Itovoi vătaf", null, "Țara Românească", "2");
RECORDS["_145"] = new MedievalDocuments("_145", 1655, "Rada Puiuleț vinde lui Badea roșu un loc în București, cu 2 galbeni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Rada Puiuleț", null, "Țara Românească", "2");
RECORDS["_146"] = new MedievalDocuments("_146", 1655, "Zahariia și fiica lui, Cârstina, adeveresc lui Manea și Gavril că au fost datori la aceștia și că în contul datoriei i-au vândut partea lor de moșie din Negomirești <j. Muscel> și niște locuri la Lacul cel Mare.", "Română", "Hârtie", "Original", "Constantin Șerban", "Zahariia și fiica lui, Cârstina", null, "Țara Românească", "2");
RECORDS["_147"] = new MedievalDocuments("_147", 1655, "Constantin Șerban voievod întărește mănăstirii Sfânta Troiță satul Lupeștii de lângă București, cu toți rumânii, după judecată în divan.", "Română", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_148"] = new MedievalDocuments("_148", 1655, "Constantin Șerban voievod întărește mănăstirii Bărbătești și stareței Nastasia o moară cu 4 roate, la Malu, pe apa Ialomiței.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "2");
RECORDS["_149"] = new MedievalDocuments("_149", 1655, "Danciul popa și frații săi din Vișina Seacă se tocmesc cu egumenul Neculai de la mănăstirea Argeș să închine aceeași moșie pe care a dăruit-o și moașa lor, Magdalina Cârjoae.", "Română", "Hârtie", "Original", "Constantin Șerban", "Danciul, Neagul și Cârstea", null, "Țara Românească", "2");
RECORDS["_150"] = new MedievalDocuments("_150", 1655, "Danciul popa și frații săi din Vișina Seacă adeveresc egumenului Neculai de la mănăstirea Argeș că au luat o carte de la mănăstire pentru a o folosi într-un proces.", "Română", "Hârtie", "Original", "Constantin Șerban", "Danciul, Neagul și Cârstea", null, "Țara Românească", "2");
RECORDS["_151"] = new MedievalDocuments("_151", 1655, "Toader postelnic, fiul lui Marco armaș, vinde lui Băjan din Guzeni o ocină la Guzeni <j. Teleorman> cu 20 ughi, pe care Bejan o răscumpără acum.", "Română", "Hârtie", "Original", "Constantin Șerban", "Toader", null, "Țara Românească", "2");
RECORDS["_152"] = new MedievalDocuments("_152", 1655, "Monahiia Vechentea vinde lui Badea roșul din Șinătești un loc cu casă și grădină în București cu 14 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Monahiia Vechentea", null, "Țara Românească", "2");
RECORDS["_153"] = new MedievalDocuments("_153", 1655, "Voico logofăt din Râmnic și fiii săi vând lui Gherghe Sărdănescul vornic două locuri în câmpul Bujoranilor și câmpul Oltenilor <la Râmnic, j. Vâlcea> cu 19 ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Voico și fiii săi", null, "Țara Românească", "2");
RECORDS["_154"] = new MedievalDocuments("_154", 1655, "Constantin Șerban voievod întărește mănăstirii Aninoasa patru oameni din Cislău, liberi de dări și bir, pentru a sluji la mănăstire.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_155"] = new MedievalDocuments("_155", 1655, "Constantin Șerban voievod poruncește slujitorilor de la Căcămeiu să dea înapoi egumenului Varlaam tot ceea ce au prădat de la mănăstirea Căldărușani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_156"] = new MedievalDocuments("_156", 1655, "Constantin Șerban voievod întărește lui Radul Dudescul logofăt moșii cumpărate de tatăl acestuia, Dumitru Dudescu fost mare vornic, la Scurtești, j. Buzău, la Râmnicenii pe Sărățel, j. Rm. Sărat și Brăila, și alte moșii și sate: Părcenii pe Călmățui, j. Râmnic, Futeștii de pe Baltă, Săcuianii lui Cernica vornic, Vârleți, j. Ialomița, Băjăneasca, j. Ilfov și Piscuri, pe Mostiște, j. Ilfov.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_157"] = new MedievalDocuments("_157", 1655, "Păduche din Gogoși scrie jupânesei Stanca, soția lui Ghiura paharnic, să dea cei 12 ughi luați de la satul Somorul, de la Ghiura paharnic.", "Română", "Hârtie", "Original", "Constantin Șerban", "Păduche", null, "Țara Românească", "2");
RECORDS["_158"] = new MedievalDocuments("_158", 1655, "Zaharia cu vărul său, Stan, și Stoica, fiii Diicului, dau zapis la mana lui Filip, fiul lui Stanciul din Baia pentru Țigani și rumâni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Zaharia cu vărul său, Stan, și Stoica, fiii Diicului", null, "Țara Românească", "2");
RECORDS["_159"] = new MedievalDocuments("_159", 1655, "Lipa, fiul lui Cincicul popa, vinde lui preda vornic 150 de stânjeni de moșie la Vlădila <j. Romanați>, cu 15 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Lipa", null, "Țara Românească", "2");
RECORDS["_160"] = new MedievalDocuments("_160", 1655, "Stancul și fratele lui, Draghiia, vând lui Papa și fraților lui 100 de stânjeni de moșie la Dobroței, cu 20 de ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stancul și fratele lui, Draghiia", null, "Țara Românească", "2");
RECORDS["_161"] = new MedievalDocuments("_161", 1655, "Jupâneasa Elina, soția lui Radu Buzescu ban, cu fiul ei, Matei, dăruiesc mănăstirii Tismana doi rumâni ai ei din Runcu, scriindu-se și la pomelnic.", "Română", "Hârtie", "Original", "Constantin Șerban", "Elina", null, "Țara Românească", "2");
RECORDS["_162"] = new MedievalDocuments("_162", 1655, "Pătru, fiul lui Stoica din Pitești, vinde lui Hrizea postelnic un loc de vie în dealul Ștefăneștilor, cu 250 bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Pătru", null, "Țara Românească", "2");
RECORDS["_163"] = new MedievalDocuments("_163", 1655, "Patru boieri jurători luați cu răvașe de Stoica, fiul lui Neguț din Suslănești, și de Gavril din Boteni mărturisesc despre rezultatul cercetărilor făcute în pricina dintre cei doi, arătând că au umblat amândoi cu pârcălabul prin județ și impunându-i la pradă.", "Română", "Hârtie", "Original", "Constantin Șerban", "Patru boieri", null, "Țara Românească", "2");
RECORDS["_164"] = new MedievalDocuments("_164", 1655, "Constantin Șerban voievod poruncește sătenilor din Vădastra, Potelu și Celeiu <j. Romanați>, să asculte de egumenul mănăstirii Bistrița și să lucreze la mănăstire.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_165"] = new MedievalDocuments("_165", 1655, "Șase boieri luați pe răvașe domnești de jupâneasa Neacșa din Răzvad <j. Dâmbovița>, și de ginerele ei, Misail clucer, împart din moșii ceea ce i se cuvine zestre fiicei sale, Marica.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri", null, "Țara Românească", "2");
RECORDS["_166"] = new MedievalDocuments("_166", 1655, "Borcea din Tăriceni și fiii săi împreună cu Stan din Crângu vând vărului lor, Dumitrașco logofăt, moșia lor din Piscul Teiului, j. Dâmbovița, cu 750 bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Borcea", null, "Țara Românească", "2");
RECORDS["_167"] = new MedievalDocuments("_167", 1655, "Barbul din Vădeni vinde lui Radu, fiul lui Lazăr din Târgu Jiu, ocină la Vădeni <j. Muscel> cu 900 de bani.", null, null, null, "Constantin Șerban", "Barbul", null, "Țara Românească", "2");
RECORDS["_168"] = new MedievalDocuments("_168", 1655, "Unchiașul Ioan Condruz din Părcenii Vechi ia pe chezășie pe unchiașul Marco pentru 20 banițe de mălai, pe care l-a luat de la mănăstirea Alunișul, urmând să plătească el dacă Marco nu va avea moștenire în moșia Colții.", "Română", null, "Copie", "Constantin Șerban", "Ioan Condruz", null, "Țara Românească", "2");
RECORDS["_169"] = new MedievalDocuments("_169", 1655, "Cârstea aprod dăruiește lui Necula aprod o moșie la Țigănești, j. Teleorman.", null, null, "Rezumat", "Constantin Șerban", "Cârstea", null, "Țara Românească", "2");
RECORDS["_170"] = new MedievalDocuments("_170", 1655, "Cârstea logofăt, fiul lui Ghionea postelnic din Brânceni, „scrie prietenește” popii Ghinea pentru tocmeala pe care au avut-o privitoare la închirierea unui loc de casă și îi cere să o respecte.", "Română", "Hârtie", "Original", "Constantin Șerban", "Cârstea", null, "Țara Românească", "2");
RECORDS["_171"] = new MedievalDocuments("_171", 1655, "Stanciul vătaf și fratele său, Gherghe, din Pisculești, j. Ialomița, vând lui Tudor și fiicei acestuia, Anca, 43 de stânjeni de moșie la Pupezeni, cu 75 de bani stânjenul.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stanciul și fratele său, Gherghe", null, "Țara Românească", "2");
RECORDS["_172"] = new MedievalDocuments("_172", 1655, "Negre vinde lui Manea 3 cedvârți de vie cu 300 de bani și 5 costande pentru găleată.", "Română", "Hârtie", "Original", "Constantin Șerban", "Negre", null, "Țara Românească", "2");
RECORDS["_173"] = new MedievalDocuments("_173", 1655, "Tudor Mârzănescul cel bătrân din Tărăciani și nepoții săi vând lui Dumitrașco logofăt moșia lor din Piscul Teiului <j. Dâmbovița>, cu 750 de bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Tudor Mârzănescul", null, "Țara Românească", "2");
RECORDS["_174"] = new MedievalDocuments("_174", 1655, "Păcală vinde lui Stan din Ulești 3 stânjeni de ocină în Cepturi <j. Sac>, cu 12 ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Păcală", null, "Țara Românească", "2");
RECORDS["_175"] = new MedievalDocuments("_175", 1655, "Ilina logofeteasă, soția lui Stroe Leurdeanu, lasă prin testament bunurile sale soțului și copiilor acestuia, surorilor ei și nepoților.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ilina", null, "Țara Românească", "2");
RECORDS["_176"] = new MedievalDocuments("_176", 1655, "Constantin Șerban voievod întărește lui Udriște Năsturel mare logofăt din Fierăști și fiului său, Radul postelnic, viile de la Vițichesti <j. Muscel>.", null, null, "Copie", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2");
RECORDS["_177"] = new MedievalDocuments("_177", 1655, "Dumitrașco dăruiește nepoților săi moșii în Clociți, Pleșcoi, Ciorăști, Aldeni, Bisăuca, <j. Buzău> și altele pentru îngrijirea acordată la vreme de bătrânețe.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dumitrașco", null, "Țara Românească", "2");
RECORDS["_178"] = new MedievalDocuments("_178", 1655, "Slamna, soția lui Pătru logofăt din Văniși, împreună cu fiicele ei vând lui Pană postelnic din Pârdesti ocină în Slăvilești <j. Romanați>, cu 8 ughi, aspri gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Slamna împreună cu fiicele ei", null, "Țara Românească", "2");
RECORDS["_179"] = new MedievalDocuments("_179", 1655, "Vasile, fost agă, fiul lui Preda spătar, vinde lui Bunea o jumătate de sat din Nănești, j. Vlașca, cu baltă, cu vii și rumâni, pentru 200 ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Vasile", null, "Țara Românească", "2");
RECORDS["_180"] = new MedievalDocuments("_180", 1655, "Vasilie, fost agă, fiul lui Preda spătar, vinde satul Boteni <j. Muscel>, lui Pârvul, mare vistier, pentru a-și plăti multe datorii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Vasile", null, "Țara Românească", "2");
RECORDS["_181"] = new MedievalDocuments("_181", 1655, "Vasilie, fost agă, fiul lui Preda spătar, vinde satul Suharna <j. Călărași> lui Pârvul mare vistier, pentru a-si plăti multe datorii.", "Română", "Microfilm", "Original", "Constantin Șerban", "Vasile", null, "Țara Românească", "2");
RECORDS["_182"] = new MedievalDocuments("_182", 1655, "Chirca, mare ban al Craiovei, judecă pricina dintre egumenul mănăstirii Tismana și Vasile paharnic, fiul lui Trandafir postelnic din Paia, pentru satul Corzii din j. Mehedinți, acesta din urmă rămânând de judecată.", "Română", "Hârtie", "Original", "Constantin Șerban", "Chirca", null, "Țara Românească", "2");
RECORDS["_183"] = new MedievalDocuments("_183", 1655, "Stan, fiul lui Dan din satul Groșani, adeverește egumenului Luca de la mănăstirea Câmpulung că el și tatăl său au fost rumâni ai mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stan", null, "Țara Românească", "2");
RECORDS["_184"] = new MedievalDocuments("_184", 1655, "Nan postelnic din Bărbătești mărturisesc egumenului Luca de la mănăstirea Câmpulung că i-au dat acestuia 100 de ughi pentru dijma din pâine, după ce s-au împăcat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Nan", null, "Țara Românească", "2");
RECORDS["_185"] = new MedievalDocuments("_185", 1655, "Constantin Șerban voievod întărește lui Necula postelnic și Radu comis să ia dijma din venitul moșiilor Șovârcul, Nanoți și Gurban, j. Vlașca.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_186"] = new MedievalDocuments("_186", 1655, "Băsărab dă mărturie mai multor moșneni din Gornovița <j. Mehedinți>, pentru o moșie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Băsărab", null, "Țara Românească", "2");
RECORDS["_187"] = new MedievalDocuments("_187", 1655, "Dobroslav din Ludănești <j. Teleorman> vinde lui Sima căpitan și Ivan logofăt partea sa de moșie din Zârna, cu 6 ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dobroslav", null, "Țara Românească", "2");
RECORDS["_188"] = new MedievalDocuments("_188", 1655, "Bunea, fiul lui Mareș din Rădulești, și fratele lui, Neagoe din Măcrești, vând 500 de stânjeni de moșie din Rădulești <j. Rm. Sărat>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Bunea și fratele lui, Neagoe", null, "Țara Românească", "2");
RECORDS["_189"] = new MedievalDocuments("_189", 1655, "Badea căpitan din Rusii de Vede vinde lui Neagoe logofăt de vistierie partea sa de moșie din Cucuiați, j. Teleorman, cu 80 de ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Badea", null, "Țara Românească", "2");
RECORDS["_190"] = new MedievalDocuments("_190", 1655, "Dionisie, episcop de Râmnic, dă mărturie despre condițiile în care Anghel vătaf a cumpărat o vie în zilele lui Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dionisie", null, "Țara Românească", "2");
RECORDS["_191"] = new MedievalDocuments("_191", 1655, "Stanca din Loloiești vinde popii Ciucuru din Săcele un vad de moară la Loloiești <j. Sac>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stanca", null, "Țara Românească", "2");
