RECORDS["_221"] = new MedievalDocuments("_221", 1655, "Constantin Șerban voievod întărește lui Theofil, egumenul mănăstirii Arnota <j. Vâlcea>, vinăriciul de la Costești, Bărbătești, Dobriceani și Bogdănești, dat de Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_222"] = new MedievalDocuments("_222", 1655, "Constantin Șerban voievod înștiințează dijmarii județului Sac că a dat egumenului Nichifor de la mănăstirea Glavacioc să ia vinăriciul domnesc de pe jumătate din moșia mănăstirii de la Cernătești <j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
