RECORDS["_234"] = new MedievalDocuments("_234", 1655, "Nedelco și fratele său, Neagu, fiii lui Vâlcan și Vladei, nepoții lui Dragomir din Belitori <j. Teleorman>, se vând rumâni lui Badea vătaf de aprozi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Nedelco și fratele său, Neagu", null, "Țara Românească", "2");
