RECORDS["_300"] = new MedievalDocuments("_300", 1655, "Mitropolitul Țării Romanești, Stefan, confirmă dania de vinărici de la Greaca <j . Ilfov> făcută de domnii Țării Leon Tomșa, Matei Basarab și Constantin Șerban mănăstirii Sărindar.", null, "Microfilm", "Original", "Constantin Șerban", "Mitropolitul Țării Romanești, Stefan", null, "Țara Românească", "2");
RECORDS["_301"] = new MedievalDocuments("_301", 1655, "Fătul, fiul lui Voico din Brătianii de Jos, j. Argeș, adeverește lui Tudoran paharnic din Aninosa că i-a zălogit partea lui de moșie din sat pentru un împrumut de 1 000 de aspri.", "Română", null, "Copie", "Constantin Șerban", "Fătul", null, "Țara Românească", "2");
RECORDS["_302"] = new MedievalDocuments("_302", 1655, "Fătul, fiul lui Voico, și Stanciul, rumânul mănăstirii Brădet, vând lui Tudoran paharnic din Aninoasa delnița lui Năvrapu din Brătianii de Jos <j. Argeș>, cu 15 ughi, bani gata, pentru partea acestuia de bir pe care a plătit-o Tudoran.", "Română", null, "Copie", "Constantin Șerban", "Fătul și Stanciul", null, "Țara Românească", "2");
RECORDS["_303"] = new MedievalDocuments("_303", 1655, "Bratul, fiul lui Badea din Brătianii de Jos, j. Argeș, vinde lui Tudoran paharnic din Aninoasa, partea lui din sat, 10 locuri, moșie stearpă, fără rumâni, cu 1 900 aspri, bani gata.", "Română", null, "Copie", "Constantin Șerban", "Bratul", null, "Țara Românească", "2");
RECORDS["_304"] = new MedievalDocuments("_304", 1655, "Bratul, fiul lui Badea din Brătianii de Jos, j. Argeș, vinde lui Tudoran paharnic din Aninoasa, partea lui din sat, moșie stearpă, fără rumâni, cu 14 ughi și jumătate, bani gata.", "Română", null, "Copie", "Constantin Șerban", "Bratul", null, "Țara Românească", "2");
RECORDS["_305"] = new MedievalDocuments("_305", 1655, "Balotă din Gârbovii de Jos vinde lui Gheorghe, mare vornic din Băleni, 80 de stânjeni de ocină în Schimbați <j. Gorj> cu 24 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Balotă", null, "Țara Românească", "2");
RECORDS["_306"] = new MedievalDocuments("_306", 1655, "Constantin Șerban voievod întărește lui Mihaiu logofăt și jupânesei sale, Stanca, fiica lui Radul Potlogeanul din Băleni, j. Dâmbovița, ocini cumpărate și moștenite.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2");
RECORDS["_307"] = new MedievalDocuments("_307", 1655, "Chira iuzbașa vinde lui Dobre logofăt, fiul lui Tatomir, jumătate de pogon de vie și o jumătate de stânjen de ocină în dealul Moceștilor <j. Buzău> pentru 6 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Chira", null, "Țara Românească", "2");
RECORDS["_308"] = new MedievalDocuments("_308", 1655, "Calea și Stanca, surorile Ilinei, cumnatele lui Stroe Leurdeanu mare logofăt, se învoiesc cu acesta pentru averea rămasă de la sora lor, moartă la Brașov, unde s-a refugiat în timpul răscoalei seimenilor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Calea și Stanca", null, "Țara Românească", "2");
RECORDS["_309"] = new MedievalDocuments("_309", 1655, "Oprea, soția lui Barcă călăraș, împreună cu fiii ei, vinde lui Petriman logofăt o curătură în Văleni <j. Dâmbovița>, cu 5 taleri.", "Română", "Hârtie", "Original", "Constantin Șerban", "Oprea împreună cu copiii ei", null, "Țara Românească", "2");
RECORDS["_310"] = new MedievalDocuments("_310", 1655, "Dumitru, fiul lui Ivan Cortofleș din Pitești, împreună cu frații lui se tocmesc cu egumenul Luca de la mănăstirea Câmpulung pentru două delnițe în dealul Piteștilor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dumitru împreună cu frații lui", null, "Țara Românească", "2");
RECORDS["_311"] = new MedievalDocuments("_311", 1655, "Constantin Șerban voievod întărește jupânesei Conda, soția lui Avram roșul din Brănești, o vie în dealul Piteștilor.", null, null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2");
RECORDS["_312"] = new MedievalDocuments("_312", 1655, "Badea din Suslănești vinde lui Dragomir al lui Gășa din Dragoslavele un loc la Sturu <j . Muscel> și mai multe livezi, cu 11 ughi.", "Română", null, "Rezumat", "Constantin Șerban", "Badea", null, "Țara Românească", "2");
RECORDS["_313"] = new MedievalDocuments("_313", 1655, "Dumitru, fiul lui Mușat din Mușcel, și Bobe din Mușcel vând lui Gherghina din Vaideel partea lor de moșie din acest sat <j. Sac>, cu 500 bani gata, respectiv 600 de bani gata.", "Română", null, "Copie", "Constantin Șerban", "Dumitru", null, "Țara Românească", "2");
RECORDS["_314"] = new MedievalDocuments("_314", 1655, "Calciul și cumnata sa, Anca, adeveresc că Toader și Grozea au făcut mai multe cumpărături în Berești, j. Argeș, iar Badea a pus zălog la Tudor moșie în Cacova.", "Română", null, "Copie", "Constantin Șerban", "Calciul și cumnata sa, Anca", null, "Țara Românească", "2");
RECORDS["_315"] = new MedievalDocuments("_315", 1655, "Constantin Șerban voievod întărește mănăstirii Codmeana și egumenului Silvestru, moșiile și rumânii din satele Bărbăteștii, Stănceștii, Carcaleții, Purcăreanii, Mogoșeștii și Ciocăneștii <j. Muscel>, dăruite de jupân Mircea.", "Română", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2");
RECORDS["_316"] = new MedievalDocuments("_316", 1655, "Constantin Șerban voievod întărește lui Bunea fost mare vistier satul Fundenii, pe Colentina, j. Ilfov, cu mori dar fără vecini, cumpărat de la Papa paharnic cu 150 galbeni, satul Grădiștea de Jos, j. Muscel, fără vecini și jumătate din satul Nănești, j. Vâlcea.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2");
RECORDS["_317"] = new MedievalDocuments("_317", 1655, "Radu, fiul lui Stoica din Bărbuleț, j. Dâmbovița, vinde lui Radu Crețulescul logofăt o livadă de fan de la Piatra Iaderii, cu 4 ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radu", null, "Țara Românească", "2");
RECORDS["_318"] = new MedievalDocuments("_318", 1655, "Stan, fiul meșterului Stan, și Nedelcu, fiul lui Ianu, vând partea lor de moșie din Urdești <j. Dâmbovița>, cu 10 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stan și Nedelcu", null, "Țara Românească", "2");
RECORDS["_319"] = new MedievalDocuments("_319", 1655, "Bratul, fiul Calei din Cacaleți, vinde lui Moise căpitan de roșii 9 stânjeni de ocină în Pârscoveni <j. Buzău>, cu 500 de bani și 4 costande, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Bratul", null, "Țara Românească", "2");
RECORDS["_320"] = new MedievalDocuments("_320", 1655, "Popa [Ion] și Stan dau zapis lui Drăghici postelnicul, înțelegându-se în privința moșiilor și a zestrei fetei lui Stoica.", "Română", null, "Original", "Constantin Șerban", "Popa [Ion], Stan și Dumitru", null, "Țara Românească", "2");
RECORDS["_321"] = new MedievalDocuments("_321", 1655, "Mihăilă, fiul popii Șerban din Izvorani, se tocmește cu Luca, egumenul mănăstirii Câmpulung, să mai primească din partea mănăstirii 2 boi și o vacă pentru o delniță din dealul Izvoranilor <j. Muscel>, „luată în silă” în timpul lui Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mihăilă", null, "Țara Românească", "2");
RECORDS["_322"] = new MedievalDocuments("_322", 1654, "Preda, nepotul lui Stanciul logofăt din Cârstienești vinde lui Stoica Băilescu din Boișoara și fratelui acestuia, Ion, delnița lui Stoica al lui Scundilă și a lui Lancie din Bumbuiești, j. Argeș, cu 16 ughi și jumătate, pentru birul pe care l-a plătit unchiul său la vremea haraciului.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_323"] = new MedievalDocuments("_323", 1654, "Șase boieri luați cu răvașe domnești de către Darie al lui Neguțu din Suslănești și Oprea, fiul Oprei vătaf, aleg moșiile și rumânii din Nămăiești și Suslănești, j. Argeș, după cărțile lor vechi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_324"] = new MedievalDocuments("_324", 1654, "Mitropolitul lgnatie al Ungrovlahiei hotărăște ca mănăstirea Mislea să fie lăsată în pace de către slugile domnești, ale Mitropoliei și de către protopopi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_325"] = new MedievalDocuments("_325", 1654, "Radu, fiul lui Colțea din Șchiai, vinde vornicului Colțea, partea lui de moșie de 35 stânjeni, la Costeni, j. Romanați, și un rumân cu feciorii lui, pentru 30 ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_326"] = new MedievalDocuments("_326", 1654, "Preda slugerul se înfrățește cu Radu Mihalcea Cândescu mare comis, dăruindu-i partea lui de ocină din Mătești, de 150 stânjeni, primind în schimb 100 ughi.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_327"] = new MedievalDocuments("_327", 1654, "Matei Basarab voievod întărește stăpânirea mănăstirii Gura Motrului și a egumenului Efrem asupra unor rumâni din Urechești, j. Gorj.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_328"] = new MedievalDocuments("_328", 1654, "Matei Basarab întărește lui Ion vătaf stăpânirea peste mai multe ocini și țigani la Corșori, Pietroșița, Poienărei și în alte părți din j. Argeș.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_329"] = new MedievalDocuments("_329", 1654, "Matei Basarab voievod întărește egumenului Ghenadie al mănăstirii Sfântul Nicolae din București pe rumânul Manea Burdela din Dralea, care susținea că ar fi fost rob în timpul ocupației lui Sinan pașa.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_330"] = new MedievalDocuments("_330", 1654, "Sătenii din Ciocănari, j. Dâmbovița, se vând rumâni, din cauza a „bogate nevoi\" lui Radu Cocorăscul mare logofăt, fiindcă acesta le plătise deja birurile.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_331"] = new MedievalDocuments("_331", 1654, "Radu și frații săi din Vășceni, Nicola, Mihăilă și alt Radu, vând lui Pană cămăraș din Căpreni două funii și jumătate din moșia de la Slăvilești, j. Romanați, pentru 12 ughi și jumătate.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_332"] = new MedievalDocuments("_332", 1654, "Dragul și frații lui, Nedelco, Stoica și Pătrașco vând lui Stoichiță Berilescu căpitan partea lor de ocină de la Sărulești, <j. Ilfov>, pentru 45 de ughi.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_333"] = new MedievalDocuments("_333", 1654, "Megiașii din Șerbănești mărturisesc că Toader a vândut lui Tanasie căpitan partea de moșie a lui Stanciu din Cucuteni, j. Romanați, cu 15 ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_334"] = new MedievalDocuments("_334", 1654, "Matei Basarab voievod întărește mănăstirii Argeș stăpânirea peste ocina din Flămânzești, potrivit cu vechile hotare stabilite încă din vremea lui Petru voievod cel Tânăr.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_335"] = new MedievalDocuments("_335", 1654, "Dan din Măgureni, împreună cu fiii lui, Stănislav, Tudor, Stan și Stanciul se vând rumâni postelnicului Iordache pentru 33 de ughi, obligându-se să stea în Rusenești, j. Romanați.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_336"] = new MedievalDocuments("_336", 1654, "Pană comis al doilea din Mâiniște vinde lui Dragul iuzbașa din Cislău 100 de stânjeni din ocina Brăgăreștilor, pentru suma de 3000 de bani, ocină cu care a fost miluit de Radu Mihalcea Cândescu mare comis.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_337"] = new MedievalDocuments("_337", 1654, "Stoica călărașul cu fiul său, Lupul și nepotul său Rade din Gruiani se răscumpără din rumânie dinspre egumenul Nectarie al mănăstirii Argeș, dând în schimb țigani, cap pentru cap.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_338"] = new MedievalDocuments("_338", 1654, "Neaga din Poinărei cu fiii săi vând lui Ion iuzbașa din Corbișori partea ei din Trestiani, j. Argeș și un loc din Scurtele, pentru 240 bani.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_339"] = new MedievalDocuments("_339", 1654, "Matei Basarab voievod întărește lui Stanciul din Ivănești, j. Ialomița, fiul lui Balea, ocină în sat cât i se va alege partea sa, precum și alte părți de ocină, cumpărate de el.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_340"] = new MedievalDocuments("_340", 1654, "Dobrotă mărturisește că este părtaș pe a patra parte din moșia Călinești, răscumpărată de la logofătul Radu Dudescul.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_341"] = new MedievalDocuments("_341", 1654, "Radul spătar, fiul lui Șerban vistier, adeverește lui Neacșu ceauș și fiului acestuia, Dumitrașco paharnic că ocina cumpărată de tatăl său la Micșani, j. Dâmbovița, le aparține acestora, fiindcă și-au exercitat dreptul de protimisis.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_342"] = new MedievalDocuments("_342", 1654, "Dragul postelnicul din Stănești vinde postelnicului Barbu 4 funii de moșie din Șușiani, j. Dâmbovița, pe 28 ughi gata.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_343"] = new MedievalDocuments("_343", 1654, "Matei Basarab voievod poruncește la 6 boieri hotarnici să delimiteze moșia lui Negoiță paharnic de către megiașii din Sufleni, j. Ialomița.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_344"] = new MedievalDocuments("_344", 1654, "Neagoe Bălan împreună cu fiii săi vinde egumenului Teofil de la mănăstirea Arnota o grădină lângă cea a mănăstirii Cozia, pentru 2 galbeni și 50 de bani.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_345"] = new MedievalDocuments("_345", 1654, "Matei Basarab voievod poruncește celor 24 de boieri hotarnici luați de Vasilie și de nepotul acestuia, Stan din Budișteni, j. Argeș, pentru a cerceta pricina acestora cu Stanciu) logofăt și Oprea logofăt pentru hotarele ocinilor de la Piscul Hoțului, Glâmbocel și Cetățele.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_346"] = new MedievalDocuments("_346", 1654, "Neagoe, feciorul babei Ana, își zălogește partea de moșie din Cătun lui Drăgan și Bărbuș pentru 29 de ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_347"] = new MedievalDocuments("_347", 1654, "Oancea din Jupânești <j. Argeș> cu fiii săi, Dragne și Vlad, se vând rumâni lui Mihalașco logofăt, cu voia soției și a fiilor.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_348"] = new MedievalDocuments("_348", 1654, "Jupâneasa Cristina, soția lui Fătul logofătul din Corșori, cu fiul ei, Dragomir și nora sa, Maria, soția fiului ei Oprea, vând partea lor din apă, cu vadul de moară din Mârzăneștii de Jos <j. Teleorman> lui Tudoran paharnic din Aninoasa cu 8 ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_349"] = new MedievalDocuments("_349", 1654, "Popa Dumitru din Prăjani dă zapis de vânzare a unei părți de ocină din Ciobănești <j. Prahova> unui grup de săteni.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_350"] = new MedievalDocuments("_350", 1654, "Coman căpitan, Mata căpitan, Costea băiașul și alții adeveresc lui Radu Mihalcea Cândescu mare comis că iau în chezășie pe Puznan căpitan, pentru niște aramă ce-o datorează.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_351"] = new MedievalDocuments("_351", 1654, "Matei Basarab voievod împuternicește pe Nicola pârcălab să o oblige pe jupâneasa lui Peia din Căpinteni să plătească toate datoriile soțului ei.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_352"] = new MedievalDocuments("_352", 1654, "Stoica postelnic din Drăgoiani, <j. Gorj>, împreună cu fratele lui, Drăghici și cu Barbu Brăiloiu vând lui Stanciu stegariu din Târgoviște un țigan „bun și sănătos\" cu 43 de ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_353"] = new MedievalDocuments("_353", 1654, "Săteni din Scăuiari <j. Gorj> se vând comisului Mihai din Florești, cu partea lor de ocină, pentru 210 ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_354"] = new MedievalDocuments("_354", 1654, "Șase boieri aleg partea de moșie din Poieni <j. Vlașca> a lui Radu spătar dinspre sătenii poienari.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_355"] = new MedievalDocuments("_355", 1654, "Sătenii din Poieni își vând părțile lor de moșie stearpă, fără rumâni, lui Radu spătar, un total de 570 de stânjeni, ca să-și plătească „nevoile\".", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_356"] = new MedievalDocuments("_356", 1654, "Popa Chirfoti eclesiarhul și preoteasa lui dau zestre fiicei lor Preda și ginerelui lor, Proca, jumătate din siliștea din satul Bărbătești pe lângă hotarul Doiceștilor <j. Dâmbovița>, o vie în dealul Bărbăteștilor, dăruită de domn de sufletul răposatei sale soții, și un cal de ginere.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_357"] = new MedievalDocuments("_357", 1654, "Stoica din Boteni vinde lui Stan și Manea 21 stânjeni de pământ.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_358"] = new MedievalDocuments("_358", 1654, "Simion cu fratele său, Loghin vând vie și vaduri de moară lui Neagoe căpitan.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_359"] = new MedievalDocuments("_359", 1654, "Costea Dălbac vinde lui Nei din Milești ocină în Milești, j. Ialomița, cu 4 ughi, moșie pe care o cumpărase când a fost jaful boierilor.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_360"] = new MedievalDocuments("_360", 1654, "Stoica Malcoci vinde lui Neagu ocină în Milești <j. Dolj>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_361"] = new MedievalDocuments("_361", 1654, "Berilă din Cerbureni și fiul său, Stancul, se vând rumâni, cu moșia lor, jupânului Marin din Argeș cu 20 de ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_362"] = new MedievalDocuments("_362", 1654, "Neaga, soția lui Andrei cojocarul din Craiova, cu fiul său Mihai, vând lui Spahiu mare ban, via de la Vălcănești, fără pământ, cu 14 ughi jumătate.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_363"] = new MedievalDocuments("_363", 1654, "Oprișa din Luciani, vinde lui Toader spătarul o ocină la Lucieni, j. Ilfov.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_364"] = new MedievalDocuments("_364", 1654, "Sima negustorul vinde lui Negoiță clucer ocină la Obedeni <j. Vlașca>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_365"] = new MedievalDocuments("_365", 1654, "Vladul din Ionești <j. Dâmbovița> cu fiii lui, Neculai, Stancul și Vișan se vând rumâni lui Iordache postelnic, fiul lui Trufanda vistier, cu partea lor de moșie.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_366"] = new MedievalDocuments("_366", 1654, "Costandin Budea vinde unchiașului Neniu ocină în Milești <j. Dolj>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_367"] = new MedievalDocuments("_367", 1654, "Pătru din Scăiești vinde lui Stănilă moșia în Tâmpa <j. Prahova>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_368"] = new MedievalDocuments("_368", 1654, "Matei Basarab voievod poruncește slujitorilor din Argeș să lase în pace satele Iași și Prăvăleni din j. Argeș, fiindcă egumenul mănăstirii Argeș i-a spus că aceste sate fugite se strâng din nou.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_369"] = new MedievalDocuments("_369", 1654, "Opriș vinde lui lvașco postelnicul moșia Cărbunarul <j. Dâmbovița>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_370"] = new MedievalDocuments("_370", 1654, "Maica Anghelina, stareța de la Râncăciov, schimbă cu Stanciul roșul locul de la Siliște.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_371"] = new MedievalDocuments("_371", 1654, "Cartea de judecată a 6 boieri mari din divan, prin care aleg partea de bunuri și prețuiesc zestrea dată de Bunea mare vistier fiicei sale, Anca, văduva lui Ianache spătar și nepotului său, Matei, despărțind-o de către cumnații acesteia, Cârstea clucer și Florescul și de către soacra ei, jupâneasa Varvara.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_372"] = new MedievalDocuments("_372", 1654, "Cârstea clucer și Florescul paharnic, fiii lui Socol mare clucer din Cornățeni, întăresc cumnatei lor Anca, fiica lui Bunea mare vistier, văduva fratelui lor, Ianache spătar, moșia de Ia Vladimirești, a patra parte și moșia de la Frumușani, în afara zestrei, pentru strădania depusă în timpul căsniciei.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_373"] = new MedievalDocuments("_373", 1654, "Patru boieri hotarnici: Pătru iuzbașa din Vârâți, Nedea din Saca, Stănilă postelnic din Vâlcănești, Ionașco Sârbul din Craiova, luați de egumenul mănăstirii Bucovăț și de Papa postelnic din Livezi, adeveresc că moșia din Povarul <j. Dolj> a fost a mănăstirii Bucovăț.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_374"] = new MedievalDocuments("_374", 1654, "Stan din Bănulești și soția sa, Maria, vinde popii Radu din Tihulești <j. Buzău> o moșie a cumnatului său, Șărbu.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_375"] = new MedievalDocuments("_375", 1654, "Matei Basarab voievod întărește lui Stoica logofăt din Bătiești, j. Argeș și fiilor lui, un rumân, Neagul din Bătiești, precum și părțile de ocină, grădini etc. cumpărate de el la Bătiești de la diverși și de la fiii Neagăi Oloaga, care lăsase prin diată dreptul de protimisis lui Stoica logofăt, în schimbul îngrijirii acesteia.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_376"] = new MedievalDocuments("_376", 1654, "Megieșii din Corșori vând lui Ion iuzbașa moșia Malei din sat, pentru 5 ughi și jumătate.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_377"] = new MedievalDocuments("_377", 1654, "Manelea din Cârtojani cu fiii ei, Ghiura și Rade, vând egumenului Partenie de la mănăstirea Roata, partea de ocină în Cârtojani <j. Vlașca>, pentru 500 de bani.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_378"] = new MedievalDocuments("_378", 1654, "Lepa și soția lui, Neacșa din Dâlga, vând o moșie în sat lui Drăghici paharnic, pentru 5 ughi și 50 de bani.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_379"] = new MedievalDocuments("_379", 1654, "Mușa din Lipărești, împreună cu fiii ei, vinde lui Radu logofăt <Țigănescu> moșie în Lipărești <j. Ialomița>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_380"] = new MedievalDocuments("_380", 1654, "Radu Liseiu face schimb de țigani cu Negoiță clucer.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_381"] = new MedievalDocuments("_381", 1654, "Matei Basarab voievod întărește lui Bunea Grădișteanu mare vistier și fiicei sale, Anca, averea ce-i revine după moartea soțului, Ianache spătar, fiul lui Socol Cornățeanu și a socrului ei, a patra parte din moșiile cuvenite acestuia, în contul zestrei.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_382"] = new MedievalDocuments("_382", 1654, "Oprea logofăt și jupâneasa lui, Maria, vând lui Stanciu logofăt moșie de la Dobroieștii de Jos, <j. Muscel>, cu 75 de ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_383"] = new MedievalDocuments("_383", 1654, "Mai mulți megiașii din Gârbovi se împrumută de la Nicola pârcălabul din Glogova de diferite sume de bani, angajându-se să-i lucreze 20 zile drept dobândă.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_384"] = new MedievalDocuments("_384", 1654, "Matei Basarab voievod întărește lui Vlad logofăt de vistierie, fiul lui Preda Bârsescu clucer, stăpânirea asupra mai multor sate și ocini din moștenirea boierilor Drăgoiești, care au fost cotropite de boierii Buzești, cu care se judecase de mai multe ori.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_385"] = new MedievalDocuments("_385", 1654, "Popa Oană dă în stăpânirea jupânesei Tudorii a căpitanului Barbu Bădeanu pe Lupa țiganca, vândută pentru 30 ughi, pentru că o crescuse această jupâneasă.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_386"] = new MedievalDocuments("_386", 1654, "Pârvul căpitan, Dumitru din Izvor și Radul din Ilfov și alți boieri megiași luați de mitropolit să cerceteze unde i-a apucat Legătura lui Mihai Vodă pe Nicola și Duca cu frații lor, adeveresc că aceștia sunt din Broscari, „unde s-au născut, au crescut și au șezut\" și nu din satul Gogoși.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_387"] = new MedievalDocuments("_387", 1654, "Doisprezece megiași jură că i-au dovedit pe Nicola și pe Duca și pe frații acestora ca născuți, crescuți și că au locuit tot în Broscari. ", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_388"] = new MedievalDocuments("_388", 1654, "Egumenul mănăstirii Govora, Dionisie, vinde părintelui Teodor de la mănăstirea Topolnița moșia de la Curiacea, <j. Mehedinți>, pentru 100 de oi și 50 de taleri. ", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_389"] = new MedievalDocuments("_389", 1654, "Avram și Radu, cu nepotul său, Radu din Morânglavi vând paharnicului Pătrașco și fratelui acestuia, Giura, partea lor de moșie din Ciorecești, <j. Romanați>, din funia ciumăgească, cu I 200 bani.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_390"] = new MedievalDocuments("_390", 1654, "Goran, fiul lui Andrei din Băbeni, vinde lui Tănasie paharnic din Sărăcinești 2 funii de moșie în Mihăiești, <j. Vâlcea>, pentru 14 ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_391"] = new MedievalDocuments("_391", 1654, "Proda călăraș vinde lui Radu al doilea portar ocină la Gănești, <j. Ilfov>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_392"] = new MedievalDocuments("_392", 1654, "Stan, Vlad și Oancea din Bughea vând muntele Piscul Râului lui Coman din Rucăr <j. Argeș>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_393"] = new MedievalDocuments("_393", 1654, "Matei Basarab voievod întărește schimbul de moșii Ia Băicoi, j. Prahova și Ia Brebu, între mănăstirea Brebul, j. Prahova și Stan, fiul lui Ioan din Brebul.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_394"] = new MedievalDocuments("_394", 1654, "Andrei și Petriman, fiii lui Vladul al lui Bobe, vând popii Gherghe din Săcuiani <j. Buzău>, curătura lor Ia Vadul lui Bădici, pentru 240 de bani.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_395"] = new MedievalDocuments("_395", 1654, "Constantin Cantacuzino fost mare postelnic poruncește globnicilor să nu bântuiască niște țigănci de la Episcopia Buzău, pentru că a făcut schimb cu Radu Mihalcea Cândescu mare comis.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_396"] = new MedievalDocuments("_396", 1654, "Papa paharnic dăruiește lui Leca iuzbașa moșie la Cepturile, j. Buzău.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_397"] = new MedievalDocuments("_397", 1654, "Stoian din Țigănești vinde finului său Vlad, o siliște de lângă Matca lui Nan.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_398"] = new MedievalDocuments("_398", 1654, "Ignatie, mitropolitul Țării Românești, adeverește egumenului Dionisie de la Mănăstirea Valea o țigancă mănăstirii Valea și alta Mitropoliei, după ce egumenul precedent de la mănăstirea Valea le-a adus cu multă cheltuială din Ardeal.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_399"] = new MedievalDocuments("_399", 1654, "lgnatie, mitropolitul Țării Românești, îngăduie fraților Stan și Datco din satul Sârbi, j. Dâmbovița, să se răscumpere din rumânie de către Mitropolie, dând în schimb, cap pentru cap, alți rumâni : Stan, cu cei trei fii ai lui, Vladul, Grozav și Ioan.", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_400"] = new MedievalDocuments("_400", 1654, "Matei Basarab voievod întărește mănăstirii Mărgineni un vad de moară și cu locul dimprejur, în orașul Târgoviște, pe apa Ialomiței. ", null, null, null, "Matei Basarab", null, "5176", "Țara Românească", "3");
RECORDS["_401"] = new MedievalDocuments("_401", 1654, "Duțe vinde vărului lui Tudoran ceauș ocină Ia Olteni, j. Râmnicul Sărat, pentru 700 de bani.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_402"] = new MedievalDocuments("_402", 1654, "Matei Basarab voievod poruncește lui Spahiul, mare ban al Craiovei să judece cu dreptate pricina dintre Semen logofăt, fiul lui Necula pârcălab și sătenii din Gârbovi și Gheorghe paharnic din Serdănești, care au încălcat moșia părintească a lui Semen de la Gârbovi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_403"] = new MedievalDocuments("_403", 1654, "Radu Popescu-Șintescu mare paharnic judecă pricina dintre Neagoe clucer și sătenii din Pâcleni, nemulțumiți că unii dintre ei împrumutaseră bani de la Neagoe clucer, dându-i în schimb ocină în sat.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_404"] = new MedievalDocuments("_404", 1654, "Tudor și Tecșan din Mătăsarul, Dumitru și frații lui din Boureni și alții se împacă cu lanea căpitan, după litigiul care l-au avut pentru niște pământuri din Piatra Curmezișată din drumul Piteștilor.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_405"] = new MedievalDocuments("_405", 1654, "Gavrilă și Drăgoicea cumpără două pogoane de loc la Ghergănel, de la Dobromir, fiul lui Tudoran armaș, cu 2 lei. ", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_406"] = new MedievalDocuments("_406", 1654, "Nedelco vinde lui Dragomir Rodescu moșie în Cioroiași cu 8 ughi.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_407"] = new MedievalDocuments("_407", 1654, "Doisprezece boieri luați de egumenul Daniil al mănăstirii Dedulești și de fiii lui Ianoș ungurul pentru moșia de la Bădicești adeveresc că cei doi s-au învoit să facă schimb: egumenul Daniil să țină moșia de la Bădicești cu vadurile de moară de sus și de jos, iar fiii lui Ianoș să țină moșia de la Munteni cu vadurile de moară.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_408"] = new MedievalDocuments("_408", 1654, "Jupâneasa Ilinca, fiica lui lui Nicolae Pătrașco voievod și nepoata lui Mihai Viteazul, adeverește megieșilor din Glaveș și Carcadulea că îi lasă să stăpânească părțile din cele două moșii care îi fuseseră restituite de către voievodul Matei Basarab, iar jumătate din celelalte sate să fie stăpânite mai departe de către mănăstirea Mărgineni unde jupâneasa Ilinca le dăruise.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_409"] = new MedievalDocuments("_409", 1654, "Ionașco postelnic din Cătun, fiul lui Miroslav logofăt vinde lui Iorgachi vornic pe Vintilă țiganul și pe fiica acestuia, Slavna, pentru 30 de galbeni.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_410"] = new MedievalDocuments("_410", 1654, "Listă a rumânilor lui Fera Racotă din Răzmirești care s-au răscumpărat, numai capetele, fără moșie.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_411"] = new MedievalDocuments("_411", 1654, "Constantin Șerban voievod întărește jupânului Bunea vistier stăpânire peste moșia de la Dușești, j. Teleorman, împreună cu rumânii care i s-au vândut succesiv cu părțile lor de ocină, precum și livezile și cânepiștile.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_412"] = new MedievalDocuments("_412", 1654, "Constantin Șerban voievod întărește lui Stanciu al preotesei din Râmnic să țină moșia Ulita de pe râul Râmnic, pentru că a plătit-o de bir în vremea lui Matei Basarab.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_413"] = new MedievalDocuments("_413", 1654, "Constantin Șerban voievod poruncește cămărașilor de la ocna Telega să nu mai trimită ciocănașii mănăstirii Mărgineni la ocna de la Râmnic, iar pe ceilalți rumâni ai mănăstirii să-i lase în pace.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_414"] = new MedievalDocuments("_414", 1654, "Constantin Șerban voievod întărește lui Apostol și fratelui său Ghinea vii la Pitești și niște țigănci și rumâni partea mamei, iar fratele lor Leca să nu aibă amestec.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_415"] = new MedievalDocuments("_415", 1654, "Constantin Șerban voievod întărește moșnenilor din <Clinceni, Măicănești, Flocești> să-și ia fiecare partea de moșie, după cum au deținut înainte.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_416"] = new MedievalDocuments("_416", 1654, "Constantin Șerban voievod întărește lui Isac iuzbașa și Mogoș iuzbașa din Buzău partea lor de ocină din Groșani, partea buzănească <j. Buzău>.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_417"] = new MedievalDocuments("_417", 1654, "Tatul logofăt și Udrea și alții vând ocina lor lui Constantin căpitanul. ", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_418"] = new MedievalDocuments("_418", 1654, "<Matei Basarab voievod> întărește dania doamnei sale Elena către clucerul Cârstea și către soția lui, Anghelina, nepoata doamnei Elina, satul Mitrești, j. Teleorman, cu toți rumânii.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_419"] = new MedievalDocuments("_419", 1654, "Bogdan cel bătrân vinde ocină la Stâlpeni <j. Argeș>.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_420"] = new MedievalDocuments("_420", 1654, "Negoiță spătar, fiul lui Ivan pitar din Văcărești întărește 8 țigani de zestre surorii sale, Alexandra și cumnatului său, Mihai.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_421"] = new MedievalDocuments("_421", 1654, "Floarea, fata lui Vasile, nepotul lui Toader din Gârbovăț, vinde unchiului ei, Bălaci, partea ei de moșie din sat.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_422"] = new MedievalDocuments("_422", 1654, "Radul, fiul lui Nedelco din Cosoba, j. Ilfov, vinde lui Radul logofăt, fiul lui Stan logofăt din Crețulești, toată partea sa de moșie din Cosoba, fără rumâni.", null, null, null, "Matei Basarab", null, null, "Țara Românească", "3");
RECORDS["_423"] = new MedievalDocuments("_423", 1654, "Preda, fiul lui Barbu logofăt din Dranovăț vinde lui popa Dumitrașco din Gărdești o țigancă.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_424"] = new MedievalDocuments("_424", 1654, "Jupâneasa Varvara, fosta soție a lui Socol clucer, împreună cu fiul ei, Adam, cu fiii ei vitregi, Cârstea și Florescul și cu nora sa, Anca, vând lui CoIțea vornic ocină în satul Ciulnița, j. Ialomița.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_425"] = new MedievalDocuments("_425", 1654, "Constantin Șerban voievod întărește lui Buliga, fost mare agă de dorobanți, dreptul de stăpânire asupra satului Seaca Carava, j. Mehedinți, cu rumânii, pentru dreaptă și credincioasă slujbă făcută domniei și țării.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_426"] = new MedievalDocuments("_426", 1654, "Constantin Șerban voievod întărește iertarea din rumânie a satului Corbi, j. Vlașca, făcută pe patul de moarte de fiul adoptiv al domnului Matei Basarab, Mateiaș postelnic Năsturel.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_427"] = new MedievalDocuments("_427", 1654, "Constantin Șerban voievod întărește lui Stănilă postelnic din Vâlcănești, j. Dolj și vărului său, Radul postelnic și nepotului său, Mihai, fiul lui Drosul postelnic, dreptul de stăpânire asupra satului Salcia de la Motru, j. Mehedinți, cu toți rumânii și cu țigănia.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_428"] = new MedievalDocuments("_428", 1654, "Șase megieși luați pe răvaș de marele vornic Preda Brâncoveanu mărturisesc despre moșia de la Ghimpeni, j. Vlașca, a lui Stanciu al lui Mâinea, a lui Vlaicu și a lui Teodosie, cumpărată de ei din codrul lui Marin <Leurdeanul>.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_429"] = new MedievalDocuments("_429", 1654, "Iorga cojocarul vinde lui Stroe <Leurdeanul> mare logofăt moșia din Găiești, j. Dâmbovița.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_430"] = new MedievalDocuments("_430", 1654, "Constantin Șerban voievod întărește lui Drăghici, fiul lui Sărdea armaș din Bănești, j. Vlașca, ocină la Sângeriș de la Gura Foi<i>.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_431"] = new MedievalDocuments("_431", 1654, "Constantin Șerban voievod întărește lui Stanciu logofăt din Budișteni, ocinile din Budișteni, Dolheștii de sus și de jos, Crângureni, toate în j. Argeș, în contul zestrei pe care ar fi trebuit să o primească din partea jupânesei Anca, soacra sa.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_432"] = new MedievalDocuments("_432", 1654, "<Patriarhul Macarie> al Antiohiei dă carte diaconului Ghinea din Râmnic să ție codrul de la Bogdănești cu moara și siliștea, cumpărate de la socrul său, Stanciul Sarchiz.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_433"] = new MedievalDocuments("_433", 1654, "Maria, fata lui Stan și sora lui Arion din Dumirești, vinde jupânului Câșlegă negustor partea ei de moșie din funia pulpască, a patra parte, pentru 34 de ughi.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_434"] = new MedievalDocuments("_434", 1654, "Stanciul, Cristian ș i Marin, fiii lui Dragomir Băltea vând lui Stoica Bălan moșie la Cărunți, cu livezile de pomi din deal cu 6 ughi.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_435"] = new MedievalDocuments("_435", 1654, "Constantin Șerban voievod întărește lui Iordache al doilea postelnic Trufanda, satul Ionești, j. Dâmbovița, cu toți rumânii, câți sunt cumpărați și miluiți de Radu Mihnea voievod.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_436"] = new MedievalDocuments("_436", 1654, "Constantin Șerban voievod întărește lui Mihai comis și fraților săi, fiii lui Dumitru stolnic Filișanul, satul Dârvariul, j. Mehedinți.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_437"] = new MedievalDocuments("_437", 1654, "Constantin Șerban voievod întărește lui Șerban postelnic și jupânesei acestuia, Cătălina, fiica lui Vasilache banul, stăpânirea peste jumătate din satul Șuța, trei roți de moară în apa Teleajenului și vii în dealul Scăienilor, confiscat de Matei Basarab voievod pentru hiclenia lui Vasilache banul.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_438"] = new MedievalDocuments("_438", 1654, "Bădica din Mihăiești vinde jupânului Zota cel Mare din Bărbulești, j. Ialomița, 20 stânjeni de moșie din partea Coruiului și 10 stânjeni din partea lui Crăciun, cu câte 44 bani stânjenul.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_439"] = new MedievalDocuments("_439", 1654, "Uncheașul Belo și fiul său, Albul din Surdești, vând jupânului Zota cel Mare 30 stânjeni de moșie în Mihăești, j. Ialomița, cu câte 44 bani stânjenul.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_440"] = new MedievalDocuments("_440", 1654, "Necula logofăt și Ion iuzbașa din Corșori mărturisesc despre pâra dintre Nan logofăt din Berivoești și Mihai postelnic din Pătroaia, pentru niște vie a lui Nan logofăt. Domnul a judecat și a dat viile să le țină Nan logofăt, care să despăgubească pe Mihai postelnic pentru cheltuiala făcută cu lucrul viilor.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_441"] = new MedievalDocuments("_441", 1654, "Constantin Șerban voievod întărește megieșilor din satul Comănița, j. Olt, dreptul de stăpânire asupra părților lor de ocină din sat, în urma judecății cu egumenul mănăstirii Deleni.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_442"] = new MedievalDocuments("_442", 1654, "Egumenul mănăstirii Bistrița, Vasilie, se învoiește cu starețul mănăstirii Argeș, Nicolae pentru vinăriciul din dealul Șoașului.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_443"] = new MedievalDocuments("_443", 1654, "Constantin Șerban voievod împuternicește mănăstirea Argeș și pe egumenul acesteia, Nicolae, să ia jumătate din vinăriciul domnesc și boieresc din dealul Șoașului, după o judecată cu mănăstirea Bistrița.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_444"] = new MedievalDocuments("_444", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș vama și judecata orașului Argeș, așa cum au lăsat toți domnii dinaintea lui.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_445"] = new MedievalDocuments("_445", 1654, "Constantin Șerban voievod poruncește celor 24 de boieri hotarnici ca să hotărască asupra moșiei Cioroiașul, dacă ea aparține locuitorilor satului sau mănăstirii Bucovăț.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_446"] = new MedievalDocuments("_446", 1654, "Constantin Șerban voievod scrie celor 12 jurători ai lui Stanciu, fiul lui Voico, Dobre, fiul lui Vlad și ai lui Moise cu frații lui, ca să jure dacă aceștia nu au fost rumâni de moșie în satul Lungi <j. Dâmbovița> care aparținea lui Iordache postelnic Trufanda.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_447"] = new MedievalDocuments("_447", 1654, "Dumitru, fiul lui Flore, din Mircești, j. Vâlcea, vând lui Cândea și fiilor lui a patra parte din funia lui Țintea, cu braniște, cu 3 ughi și 70 de bani.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_448"] = new MedievalDocuments("_448", 1654, "Constantin Șerban voievod întărește lui Alexandru al doilea postelnic și jupaniței lui, Marica, nepoata doamnei Elena, satul Herăștii, j. Ilfov, cu rumânii, balta și morile de pe apa Ialomiței.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_449"] = new MedievalDocuments("_449", 1654, "Constantin Șerban voievod întărește lui Iordache al doilea postelnic, fiul lui Trufanda vistier, stăpânirea peste mai mulți vecini din satul lonești, j. Dâmbovița, cu care se judecase în divan.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_450"] = new MedievalDocuments("_450", 1654, "Constantin Șerban voievod întărește Episcopiei de Râmnic dreptul de stăpânire asupra satului Plăviceni, j. Romanați, toată partea Doamnei Stanca, după ce Dragomir mare vornic din Plăviceni împresurase acest sat.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_451"] = new MedievalDocuments("_451", 1654, "Constantin Șerban voievod întărește lui Tudorie paharnic, fiul lui Harvat spătar, și soției lui, Păuna, satul Curăteștii de pe Neajlov, primit de zestre de la Cârstea căpitanul din Târgoviște.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_452"] = new MedievalDocuments("_452", 1654, "Douăzeci și patru de boieri aleg moșia Cioroiașul a mănăstirii Bucovățul, după ce mănăstirea a avut pâră cu satul și după ce domnul a întărit hotărnicia făcută în vremea lui Matei Basarab voievod.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_453"] = new MedievalDocuments("_453", 1654, "Radul și cumnatul lui, Dumitru, împreună cu soțiile lor Boba și Neacșa, fetele Dumitrei din Cucuteni, vând episcopului Buzăului, Serafim, moșie la Cucuteni, „moșie muierească\", cu pădure în crâng, pentru 5 ughi și jumătate.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_454"] = new MedievalDocuments("_454", 1654, "Constantin Șerban voievod poruncește celor 6 boieri luați pe răvaș de Manta, fiul lui Pană din Câmpulung și de egumenul Ioasaf de la mănăstirea din Câmpulung, ca să adeverească pentru o dârstră la Lerești, j. Argeș, făcută de egumen pe iazul lui Manta.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_455"] = new MedievalDocuments("_455", 1654, "Constantin Șerban voievod întărește lui Simion, fiul lui Lăudat din Beleți, j. Muscel, pe Vlădilă țiganul, după o pâră cu egumenul Daniil de la mănăstirea Râncăciov.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_456"] = new MedievalDocuments("_456", 1654, "Constantin Șerban voievod întărește mănăstirii Glavaciog și egumenului Nichifor ocină în satul Cernătești, j. Sac, jumătate de sat cu rumânii și viile, după o pâră pe care au avut-o cu rumânii din sat.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_457"] = new MedievalDocuments("_457", 1654, "Constantin Șerban voievod întărește mănăstirii Bucovăț și egumenului loanichie satul Cioroiașul, j. Dolj, cumpărată de Pârvul clucerul, fiul lui Stepan banul, ctitorii mănăstirii, după o pâră cu satul Cioroiașul.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_458"] = new MedievalDocuments("_458", 1654, "Constantin Șerban voievod întărește moșnenilor din satul Păpălari, j. Romanați, dreptul de stăpânire asupra părților lor de ocină din sat, care le fusese luată cu silnicie de Matei Basarab voievod și dăruită ctitoriei familiei sale de la Brâncoveni.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_459"] = new MedievalDocuments("_459", 1654, "Constantin Șerban voievod întărește lui Vlad mazilul și altora o ocină în satul Sărățeni, j. Ialomița, în urma judecății cu călugării de la mănăstirea Vaideei.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_460"] = new MedievalDocuments("_460", 1654, "Constantin Șerban voievod întărește mănăstirii Potoc, <j. Dâmbovița>, jumătate din satul Celei din j. Romanați, cu rumânii și cu tot venitul, donat de ctitorii ei, în urma judecății cu mănăstirea Arnota, căreia Matei Basarab îi dăruise aceste averi.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_461"] = new MedievalDocuments("_461", 1654, "Constantin Șerban voievod îl împuternicește pe Gheorghe vornic din Sărdenești să-l oblige pe Stamatie paharnic, fiul lui Miloș Cuza din Copăceni, j. Gorj, să-i plătească datoria.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_462"] = new MedievalDocuments("_462", 1654, "Constantin Șerban voievod poruncește celor 4 boieri adeveritori ai lui Stoica din Suslănești și ai lui Gavril din Boteni, să soluționeze pricina dintre Stoica din Suslănești și Gavril din Boteni și anume dacă au umblat cu Radu pârcălab, încasând impozite în județ.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_463"] = new MedievalDocuments("_463", 1654, "Patriarhul Macarie al Antioihiei întărește lui Neagul mare portar și fiilor săi stăpânirea satului Băcălești, j. Olt, cu rumânii, lăsat de unchiul acestuia, Dumitru Ochiută.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_464"] = new MedievalDocuments("_464", 1654, "Constantin Șerban voievod întărește megiașilor din Șchiopeni, j. Buzău, jumătate din sat, în urma unei pâri cu Rada, soția lui Marco armaș și cu Toader postelnic, fiul acestuia.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_465"] = new MedievalDocuments("_465", 1654, "Udrea comis, fiul lui Hrizea mare vornic din Bălteni, și jupâneasa lui, Alexandra adeveresc unchiașului Badea și fii lor acestuia că le-au vândut părțile lor d e moșie din Tegeni și din Ștefănești, fără voia lor, domnul Constantin Șerban dându-le voie să răscumpere aceste moșii.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_466"] = new MedievalDocuments("_466", 1654, "Constantin Șerban voievod întărește mănăstirii Jdreala, j. Dolj, să țină pe toți oamenii străini: greci, sârbi, albanezi ce s-au adunat și stau pe lângă mănăstire, scutindu-i de toate dările, cu condiția să devină poslușnici ai mănăstirii.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_467"] = new MedievalDocuments("_467", 1654, "Stanciu logofăt din Bogătești vinde egumenului Ioasaf al mănăstirii Câmpulung un munte la Rucăr, aflat în dispută cu sătenii din Rucăr <j. MusceI>.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_468"] = new MedievalDocuments("_468", 1654, "Mărturia sătenilor din Țâța, j. Dâmbovița, că Tiodoru a cumpărat un loc de la Radul al lui Brașov, în Mlăci, lat de 30 stânjeni, cu 7 ughi fără adălmaș.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_469"] = new MedievalDocuments("_469", 1654, "Constantin Șerban voievod dă voie lui Cârstea iuzbașa de roșii să-și ia înapoi de la urmașii lui Drăgușin paharnic, Gorgan și frații acestuia, țiganii luați de acesta „în silă\".", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_470"] = new MedievalDocuments("_470", 1654, "I van cu frații lui, Stanciu și Paraschiv și alții vând o vie din Dealul de la Alun, împreună cu alte acareturi și obiecte, unchiului lor, Filip <din Baia>.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_471"] = new MedievalDocuments("_471", 1654, "Unchiașul Stoica Robul din Neagovani adeverește egumenului de la Snagov că a avut 3 pogoane de vie ale sale pe ocina mănăstirii de la Negovanul, pe care le-a lăsat mănăstirii, neputându-le lucra.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_472"] = new MedievalDocuments("_472", 1654, "Tănasie, fiu lui Necula logofăt din Sărăcinești, j. Vâlcea, închină moșia de la Frăgași mănăstirii Cozia și egumenului acesteia, Ștefan, pentru pomenirea sa și a părinților săi.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_473"] = new MedievalDocuments("_473", 1654, "Constantin Șerban voievod întărește lui Iordache postelnic, fiul lui Trufanda vistier, și urmașilor lui, stăpânire peste partea jupânesei Neaga Mitroaia vorniceasa pe care o avea în satul Lungi, cu toți vecinii, cu morile și cu tot venitul.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_474"] = new MedievalDocuments("_474", 1654, "Costea și frații lui, Ivan și Oprea, împreună cu mama lor vând lui Firea o păresiște în dealul Crângurenilor, la Budișteni, j. Argeș.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_475"] = new MedievalDocuments("_475", 1654, "Constantin Șerban voievod întărește hotărârea voievodului Matei Basarab acordată Episcopiei Buzăului să-i fie iertați de bir și dăjdii curtenii și poslușnicii, precum și păstorii, morarii și oamenii de la odaia de la Cărpești, cu condiția ca aceștia toți să slujească Episcopiei.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_476"] = new MedievalDocuments("_476", 1654, "Constantin Șerban voievod întărește dania lui Matei Basarab făcută Episcopiei Buzăului pentru cei 300 de bolovani de sare de la ocna din Ghitioara și poruncește cămărașilor de la ocnă să dea merticul la vreme.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_477"] = new MedievalDocuments("_477", 1654, "Constantin Șerban voievod întărește lui Mogoș căpitan din Păulești, j. Prahova, niște țigani boierești care fugiseră în Țara Turcească, pentru că a fost trimis de Matei Basarab voievod să-i aducă în țară de peste Dunăre.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_478"] = new MedievalDocuments("_478", 1654, "Constantin Șerban voievod poruncește celor 1 2 jurători ai lui Stan din Prodilești să jure că Stan nu a fost rumân la mănăstirea Strâmbul și nici nu l-a apucat Legătura lui Mihai vodă în acel sat.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_479"] = new MedievalDocuments("_479", 1654, "Costea și frații lui, I van și Oprea, împreună cu mama lor vând lui Firea o păresiște în dealul Crângurenilor, la Budișteni, j. Argeș, cu 360 de bani și cu știrea megiașilor.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_480"] = new MedievalDocuments("_480", 1654, "Nicola al toboșarului, Ciucu al gelepului, Stanciul al lui Băcilă și Pârvu Robu <din Săcelu, j. Gorj> se vând rumâni lui Nicola pârcălab din Glogova.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_481"] = new MedievalDocuments("_481", 1654, "Constantin Șerban voievod întărește lui Stoian și fraților acestuia, Oancea, Radul, Stan, Mihnea și Ion, fiii lui Albul din Davidești, j. Argeș, stăpânirea asupra unor părți de ocină în Davidești cumpărate de la Dumitru pentru 1300 de aspri.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_482"] = new MedievalDocuments("_482", 1654, "Constantin Șerban voievod poruncește lui Dumitru și lui Vlaicu din Groși să-l constrângă pe Constantin căpitanul să plătească 434 de ughi, sumă luată de tatăl lui Constantin căpitanul, Radu armașul, cu sila de la Viai cu.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_483"] = new MedievalDocuments("_483", 1654, "Constantin Șerban voievod întărește lui Negoiță paharnic, nepotul doamnei Neaga, stăpânirea peste niște rumâni din Tătărani , pe care îi avea de moștenire de la tatăl său, Preda postelnic din Tătărani.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_484"] = new MedievalDocuments("_484", 1654, "Mihai clucerul și Giura clucer se înțeleg cu Pană cămărașul să le vândă satul Cacoții, pentru că aceștia l-au plătit de bir.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_485"] = new MedievalDocuments("_485", 1654, "Nan, fratele lui Vișan din Scăiani, adeverește lui Moise căpitanul că i-a vândut părțile de moșii din Scăiani, Bâsca și Ulmet.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_486"] = new MedievalDocuments("_486", 1654, "Constantin Șerban voievod întărește lui Iordache postelnic, stăpânirea peste sătenii din Negrași , ce i s-au vândut ca vecini.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_487"] = new MedievalDocuments("_487", 1654, "Stamate călăraș, Toader ceauș Necula, Apostol și alții vând lui Lupșa o moșie de 44 de stânjeni pentru 2200 de bani.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_488"] = new MedievalDocuments("_488", 1654, "Constantin căpitan, fiul lui Radu armaș, vinde lui Iorga și Pană negustori satul Groși, j. Argeș, cu rumânii și cu via pentru 434 ughi, bani pe care îi prădase tatăl lui de la acești negustori, fără nici o vină.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_489"] = new MedievalDocuments("_489", 1654, "Pătrașcu ceaușul și frații lui, Iancul și Dumitru, vând lui Constantin Cantacuzino fost mare postelnic, un loc de casă, lângă biserica Tabacilor în București.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_490"] = new MedievalDocuments("_490", 1654, "Mihai postelnic, fiul lui Toma comis din Pătroaia, adeverește lui Iordache postelnic, fiul lui Trufanda fost mare vistier, că o seamă de rumâni au fost mai întâi ai unchiului său, Leca spătar, dar după judecățile domnești, acum i se cuvin lui Iordache postelnic.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_491"] = new MedievalDocuments("_491", 1654, "Constantin Șerban voievod hotărăște ca jupâneasa Caplea din Florești și Paraschiv din Cepturoaia să dea lui Preda spătar din Cepturoaia un alt sat la schimb pentru Cioroboreni.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_492"] = new MedievalDocuments("_492", 1654, "Constantin Șerban voievod întărește tuturor slujitorilor care au moșie în stăpânire la Bălănești <j. Râmnicu Sărat> să țină aceste moșii, fiind ei contribuabili la haraciul împăratului.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_493"] = new MedievalDocuments("_493", 1654, "Constantin Șerban voievod dăruiește mănăstirii Snagov satul Dobroșești, j. Ilfov, iertându-l de toate dările de peste an, mănăstirea să aibă pace de toți slujitorii și drept exclusiv de judecată, precum și zeciuiala de vin din podgoria Cernătești.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_494"] = new MedievalDocuments("_494", 1654, "Iane mătăsar și soția lui, Voica, vând jupânului Teodori Chiurcia o prăvălie în Târgul de Jos din București, împreună cu locul ei, pentru 45 de ughi.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_495"] = new MedievalDocuments("_495", 1654, "Ștefan logofăt din Ciorani, împreună cu fratele său, Vasilie iuzbașa, vând 300 stânjeni de moșie în Mircești lui Neagoe logofăt de vistierie.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_496"] = new MedievalDocuments("_496", 1654, "Constantin Șerban voievod poruncește jupânesii Stanca să restituie 12 ughi popii Tatomir, împrumutați de la Radul Păduche din Gogoși ca să plătească mierea satului.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_497"] = new MedievalDocuments("_497", 1654, "Constantin Șerban voievod întărește lui Ilea paharnic, Paraschiva paharnic și lui Manea paharnic din Urechești, j. Râmnicul Sărat, dreptul de stăpânire asupra mai multor pogoane de vie în dealul Teișului.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_498"] = new MedievalDocuments("_498", 1654, "Constantin Șerban întărește lui Neagul paharnic, fiul lui Stan, și altor megiași stăpânirea asupra unor părți de ocină în hotarul Frăsinetului și în Devesel.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_499"] = new MedievalDocuments("_499", 1654, "Constantin Șerban voievod poruncește celor șase boieri judecători luați de megiașii din satul Șovârcu, de Radul comis și Necula postelnic, să adevereze dacă Zaharia sluger, moșul lui Radu) comis și Necula postelnic, a avut parte de moșie în Șovârcu.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_500"] = new MedievalDocuments("_500", 1654, "Constantin Șerban voievod întărește lui Lupul călăraș din Călugăreni, Oprea călăraș ș. a. stăpânirea asupra moșiei Grozeștii, j. Teleorman, pe care o aveau de la părinții lor.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_501"] = new MedievalDocuments("_501", 1654, "Constantin Șerban voievod întărește lui Cilibia ceauș de dorobanți din Tâmna dreptul de a lua dijmă din toată zeciuiala de pe moșia lui, Pavlețul din j. Mehedinți.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_502"] = new MedievalDocuments("_502", 1654, "Constantin Șerban voievod întărește lui Cilibia ceauș de dorobanți din Tâmna, fiul lui Frățilă, stăpânire în ocina satului Tâmna, cumpărată de la Danciul vornic, tatăl lui Matei Basarab.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_503"] = new MedievalDocuments("_503", 1654, "Constantin Șerban voievod poruncește celor 24 de boieri jurători ai lui Neagul portar să jure că acesta nu a rumânit în silă satul Mărăcinenii, j. Dâmbovița.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_504"] = new MedievalDocuments("_504", 1654, "Constantin Șerban voievod întărește lui Alexie ceauș, fiul lui Mihai Carșote din Mărăcineni, stăpânirea peste partea de ocină din Dedulești a lui Dumitrașco, fiul lui Alexie din orașul de Floci.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_505"] = new MedievalDocuments("_505", 1654, "Constantin Șerban voievod întărește lui Danciu călăraș și altora stăpânirea asupra părților lor de ocină din satul Stănești de Obreje, j. Vlașca, împresurate de Matei Basarab.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_506"] = new MedievalDocuments("_506", 1654, "Constantin Șerban voievod volnicește pe sătenii din Mușătești, Stoica, Priba, Tatul și Dragne să răscumpere părțile lor de moșie lor din satul Mușătești de pe Vedea, j. Teleorman.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_507"] = new MedievalDocuments("_507", 1654, "Constantin Șerban voievod întărește lui Vintilă și lui Drăgoiu căpitan, ginerele lui Tudosie ban, stăpânirea asupra unor părți de ocină în Găujani, j. Ilfov.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_508"] = new MedievalDocuments("_508", 1654, "Doisprezece boieri luați de Chirca mare stolnic și Hera roșul din Berești, cu Mănăilă paharnic din Văleni, aleg moșia lor din satul Văleni, j. Olt, și hotărăsc să se facă 2 roate de moară în vadul ce-l au împreună.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_509"] = new MedievalDocuments("_509", 1654, "Ignatie, egumenul mănăstirii Mihai Vodă, și Stoica paharnic din Dragomirești adeveresc megieșilor din Stănești dreptul de a stăpâni în pace moșia lor, ce fusese împresurată de Matei Basarab.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_510"] = new MedievalDocuments("_510", 1654, "Neacșul și Stroe, împreună cu nepoții lor, vând popii Simca partea de ocină a lui Tatu din Fundeani și din Salce pentru 6 ughi și 20 bani.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_511"] = new MedievalDocuments("_511", 1654, "Constantin Șerban voievod împuternicește pe Jipa postelnic din Vernești să fie volnic, împreună cu o slugă domnească, să ridice niște țigani de la Radu logofăt Dudescu cu care a avut judecată în divan.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_512"] = new MedievalDocuments("_512", 1654, "Constantin Șerban voievod întărește mănăstirii Sadova dreptul de stăpânire asupra rumânilor din Gârleni, j. Dolj, și a părților lor de moșie care s-au vândut lui Matei Basarab.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_513"] = new MedievalDocuments("_513", 1654, "Constantin Șerban voievod întărește lui Stoica, fiul lui Neagul din Felii, stăpânirea peste 3 pogoane de vie în Găvana, j. Prahova, cu un stânjen de ocină, partea lui Coman.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_514"] = new MedievalDocuments("_514", 1654, "Arca din Stolojani, fiul lui Tatomir, vinde lui Dușe postelnic din Stolojani un loc la Lacul Frasinilor. Dușe postelnic mai cumpără și de la alții locuri și părți de moșie.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_515"] = new MedievalDocuments("_515", 1654, "Mai mulți megiași din Glupavi dau zapisul lor la mâna lui Gheorghe vistier, cum că i-au vândut acestuia partea lor de moșie din sat, ca să se răscumpere din rumânie.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_516"] = new MedievalDocuments("_516", 1654, "Megieșii din Saca adeveresc lui Andrei postelnic că nu au avut putere să se răscumpere din rumânie, atunci când Constantin Șerban voievod a îngăduit ca satele lui Matei Basarab voievod să se răscumpere din rumânie.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_517"] = new MedievalDocuments("_517", 1654, "Constantin Șerban voievod întărește lui Stepan postelnic din Stoiceani să stăpânească moșia Costeani, j. Ialomița, cu viile de la Săteni, după moartea cumnatei sale, Anca.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_518"] = new MedievalDocuments("_518", 1654, "Calea, fata lui Gostilă, vinde lui Stanciul partea ei de ocină <din Trânșani>.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_519"] = new MedievalDocuments("_519", 1654, "Șase boieri hotarnici luați de Stoican paharnic din Cârlomănești și Negoi clucer adeveresc care este drumul lui Stoican, în timp ce drumul lui Negoi clucer nu este acolo, ci pe vale.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_520"] = new MedievalDocuments("_520", 1654, "Constantin Șerban voievod scrie lui Pană cămăraș, „care este oier\", că înaintea sa au venit călugării de la mănăstirea Segarcea și că i-a scutit de toate dările de peste an.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_521"] = new MedievalDocuments("_521", 1654, "Constantin Șerban voievod întărește lui Mihai comis și fraților săi, Preda și Barbu, fiii lui Dumitru Filișanu fost mare stolnic, dreptul de stăpânire asupra satelor Dârvariul și Risipiți, j. Mehedinți.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_522"] = new MedievalDocuments("_522", 1654, "Constantin Șerban voievod întărește jupaniței Mihna și surorii ei, Marula logofeteasa, fetele lui Ilie vornic din Cornești, dreptul de stăpânire asupra satul Hăndreșăștii, j. Ialomița, și cu rumânii cu care au avut pâră în divan.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_523"] = new MedievalDocuments("_523", 1654, "Constantin Șerban voievod întărește sătenilor din Brebu, j. Prahova, dreptul de a stăpâni ocina satului împreună cu mănăstirea Sf. Mihail din sat, ctitorită de Matei Basarab voievod.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_524"] = new MedievalDocuments("_524", 1654, "Constantin Șerban voievod întărește stăpânirea lui Barbu cupariul asupra rumânului Radu din Bărbărești cu fiii lui, în urma judecății avute cu Lupul și Pătru.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_525"] = new MedievalDocuments("_525", 1654, "Constantin Șerban voievod întărește negustorilor chiproviceni scutirea de toate dările, în schimbul unui „bir cu rupta\", o dată pe an, în valoare de 130 de ughi.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_526"] = new MedievalDocuments("_526", 1654, "Constantin Șerban voievod întărește lui Buliga fost aga din Ciovârnășani dreptul de stăpânire asupra mănăstirii Topolnița, j. Mehedinți, iertând toate proprietățile mănăstirii de plata dăjdiilor.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_527"] = new MedievalDocuments("_527", 1654, "Constantin Șerban voievod întărește mănăstirii Coșuna, de lângă Craiova, un loc de casă din București, dăruit acesteia de Pârvul fost mare logofăt.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_528"] = new MedievalDocuments("_528", 1654, "Jupânița Stănae <din Gherghița> și fiii ei adeveresc că au luat bani cu dobândă 80 ughi de la părintele Varlaam de la mănăstirea Căldărușani.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_529"] = new MedievalDocuments("_529", 1654, "Preda Brâncoveanu mare vornic, în calitate de moștenitor al bunurilor personale ale voievodului Matei Basarab adeverește, în urma unui jurământ pe Evanghelie, că Andrei spătarul are dreptul să-și recupereze țiganii pe care răposatul voievod i-a luat, fără să plătească nimic.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_530"] = new MedievalDocuments("_530", 1654, "Manea și verii lui, Neagul, Ion și Bărcan, vând lui Tănasie portar parte de moșie în Oiești, j. Teleorman, cu 4 ughi.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_531"] = new MedievalDocuments("_531", 1654, "Șase boieri aleg părțile de moșie cumpărate de Radu armașu în Budești, județul Râmnicul Sărat, de la Necula din Ursești, delimitându-le de proprietatea mănăstirii Urechești.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_532"] = new MedievalDocuments("_532", 1654, "Vlad, fiul lui Oprea Gogoș, vinde lui Pană cămărașul ocina lui din satul Turburea, cu vad de moară, pentru 6 ughi.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_533"] = new MedievalDocuments("_533", 1654, "Constantin Șerban voievod iartă pe poslușnicii care se află pe moșiile mănăstirii <Dintrunlemn>, județul Vâlcea, de bir și de toate dajdiile, cu condiția să slujească pe mai departe pe starețul acesteia.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_534"] = new MedievalDocuments("_534", 1654, "Constantin Șerban voievod poruncește vameșilor de la bălțile Potelu și Celeiu să dea mănăstirii Bistrița, din partea domnească, al treilea ban, din cârmă și din tot venitul bălților.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_535"] = new MedievalDocuments("_535", 1654, "Sava logofăt, Șerban căpitan, Iancu logofăt și alții se tocmesc cu egumenul Varlaam de la mănăstirea Căldărușani pentru 300 de stânjeni de ocină la Ciorani ca acesta să le plătească contravaloarea pământului, despre care pretinsese că fusese lăsat mănăstirii de tatăl acestor boieri, Oancea logofăt.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_536"] = new MedievalDocuments("_536", 1654, "Constantin Șerban poruncește episcopului de Buzău și vornicului Colțea Doicescu să nu mai împresoare viile megiașilor din Văleni, j. Buzău.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_537"] = new MedievalDocuments("_537", 1654, "Constantin Șerban voievod întărește mănăstirii Coșuna de lângă Craiova și egumenului acesteia, Ionichie, satele Perișorul și Radovanul din județul Mehedinți, în urma verificării actelor de proprietate și a actelor de vânzare a rumânilor.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_538"] = new MedievalDocuments("_538", 1654, "Constantin Șerban voievod scutește de bir și de toate dăjdiile pe locuitorii din Sinești, j. Prahova, care locuiesc în jurul mănăstirii Mislea și o slujesc.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_539"] = new MedievalDocuments("_539", 1654, "Constantin Șerban voievod întărește lui Sirea roșul și fratelui acestuia, Gheorghie roșul, din Pleșcoi, j. Buzău, ocina cumpărată de ei în Negoșina, în urma unei judecăți pierdute de Bratul, ginerele vânzătorului.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_540"] = new MedievalDocuments("_540", 1654, "Ghinea postelnic din Cătun scrie egumenului Nicodim al mănăstirii Tismana despre niște țigănci ale mănăstirii, fugite cu niște țigani ai lui, despre care se angajează să le înapoieze mănăstirii.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_541"] = new MedievalDocuments("_541", 1654, "Stoica și Stănie vând lui Ventilă, lftenie și lui Neacșul partea lor de loc <din Beleți>, cu 28 de costande.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_542"] = new MedievalDocuments("_542", 1654, "Constantin Șerban voievod întărește lui Barbul cupariul și lui Udriște cămăraș, cu fiii lor, ocină în Mârzănească de Jos, < j. Ilfov>.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_543"] = new MedievalDocuments("_543", 1654, "Gorgan clucer, Necula și Fota, fiii lui Drăgușin paharnic, răscumpără de la Voica al doilea paharnic jumătate din satul Runcu, cu 600 ughi, și partea lui Gheorghe postelnic, cu 190 ughi.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_544"] = new MedievalDocuments("_544", 1654, "Constantin Șerban voievod întărește eliberarea din rumânie a sătenilor din Căzăneștii Spatăi, din plasa de la Vale, j. Olt, dinspre fiii lui Drăgușin paharnic.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_545"] = new MedievalDocuments("_545", 1654, "Constantin Șerban voievod întărește jupânesei Neacșa, fata lui Costea sluger, fiului său, Mihalcea logofăt, și cu frații lui, din Crevedia, de pe apa Neajlovului, județul Vlașca, moșie în satul Crevedia.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_546"] = new MedievalDocuments("_546", 1654, "Constantin Șerban voievod întărește mănăstirii Viforâta și monahiei Magdalina dreptul de stăpânire asupra satelor Vărăștii și Gurguiații de pe Mostiște, j. Ilfov.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_547"] = new MedievalDocuments("_547", 1654, "Constantin Șerban voievod poruncește Dumitrei, văduva lui Mihai șoimaru din Târgoviște, și rudelor acesteia să nu mai aibă nici o pretenție asupra logofătului Dumitru Bădilă din Târgoviște, în pricina pentru un loc și trei prăvălii la Târgoviște.", null, null, null, "Constantin Șerban", null, "5176", "Țara Românească", "3");
RECORDS["_548"] = new MedievalDocuments("_548", 1654, "Șase boieri, luați pe răvașe domnești de Manta, fiul lui Pană din Câmpulung și de egumenul Iosaf de la mănăstirea Câmpulung, adeveresc pentru un iaz și o moară care aparțineau lui Manta.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_549"] = new MedievalDocuments("_549", 1654, "Constantin Șerban voievod întărește jupanului Radu Cocorăscu fost mare logofăt 14 scutelnici pe ocina sa de la Palanga, j. Ilfov și doi lopătari, oameni străini, fiind o moșie dăruită de Șerban voievod pentru dreaptă și credincioasă slujbă.", null, null, null, "Constantin Șerban", null, "13689", "Țara Românească", "3");
RECORDS["_550"] = new MedievalDocuments("_550", 1654, "Constantin Șerban voievod întărește egumenului de la mănăstirea Radu Vodă din București dijma din satele mănăstirii, Chiseleț, Găunoșii, Dichiseni.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_551"] = new MedievalDocuments("_551", 1654, "Constantin Șerban voievod întărește lui Stepan postelnic și fiului său, Tănasie, un rumân, Iane din Bălcești.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_552"] = new MedievalDocuments("_552", 1654, "Constantin Șerban voievod întărește lui Tudoran paharnic, fiul lui Iane paharnic, din Aninoasa, j. Mușcel, o țigancă, în urma unui schimb cu Antonie din Rătești.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
RECORDS["_553"] = new MedievalDocuments("_553", 1654, "Constantin Șerban voievod întărește egumenului de la mănăstirea Radu Vodă din București dreptul asupra vămii de pește din balta de la Chiseleț și asupra părpărului.", null, null, null, "Constantin Șerban", null, null, "Țara Românească", "3");
